import{_ as d,a as r,b as i,c as a,d as n,e as o,f as l,g as s,h,i as p,j as u}from"./chunks/airlink-reference-design.BXEk6JF_.js";import{_ as c,c as m,o as g,ab as e,m as t}from"./chunks/framework.CUflZczI.js";const G=JSON.parse('{"title":"Sky-Drones AIRLink","description":"","frontmatter":{},"headers":[],"relativePath":"zh/flight_controller/airlink.md","filePath":"zh/flight_controller/airlink.md"}'),b={name:"zh/flight_controller/airlink.md"},f=e('<h1 id="sky-drones-airlink" tabindex="-1">Sky-Drones AIRLink <a class="header-anchor" href="#sky-drones-airlink" aria-label="Permalink to &quot;Sky-Drones AIRLink&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://sky-drones.com/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><a href="https://sky-drones.com/airlink" target="_blank" rel="noreferrer">AIRLink</a> stands for Artificial Intelligence &amp; Remote Link. The unit includes a cutting-edge drone autopilot, AI mission computer and LTE/5Gs connectivity unit. AIRLink helps to reduce the time to market for new drone manufacturers from years and months down to weeks.</p><p><img src="'+d+'" alt="AIRLink"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This flight controller is <a href="./../flight_controller/autopilot_manufacturer_supported.html">manufacturer supported</a>.</p></div><p>AIRLink has two computers and integrated LTE Module:</p><ul><li>The flight control computer (autopilot) has a triple-redundant vibration-dampened and temperature-stabilized IMU.</li><li>The powerful AI mission computer enables advanced drone software features like computer vision and obstacle avoidance, digital HD video streaming, and payload data streaming.</li><li>LTE/5G and WiFi connectivity modules provide permanent broadband internet connection which is enabler for remote workflows.</li></ul><h2 id="feature-highlights" tabindex="-1">Feature Highlights <a class="header-anchor" href="#feature-highlights" aria-label="Permalink to &quot;Feature Highlights&quot;">​</a></h2>',8),T=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/VcBx9DLPN54",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),k=e('<h2 id="specifications" tabindex="-1">Specifications <a class="header-anchor" href="#specifications" aria-label="Permalink to &quot;Specifications&quot;">​</a></h2><ul><li><p><strong>Sensors</strong></p><ul><li>3x Accelerometers, 3x Gyroscopes, 3x Magnetometers, 3x Pressure sensorss</li><li>GNSS, Rangefinders, Lidars, Optical Flow, Cameras</li><li>3x-redundant IMU</li><li>Vibration dampening</li><li>Temperature stabilization</li></ul></li><li><p><strong>Flight Controller</strong></p><ul><li>STM32F7, ARM Cortex M7 with FPU, 216 MHz, 2MB Flash, 512 kB RAM</li><li>STM32F1, I/O co-processor</li><li>Ethernet, 10/100 Mbps</li><li>LAN with AI Mission Computer</li><li>8x UARTs: Telemetry 1, Telemetry 2 (AI Mission Computer), Telemetry 3, GPS 1, GPS 2, Extra UART, Serial Debug Console, IO</li><li>2x CAN: CAN1, CAN2</li><li>USB with MAVLink</li><li>Serial console for debugging</li><li>RC Input, SBUS input, RSSI input, PPM input</li><li>16x PWM servo outputs (8 from IO, 8 from FMU)</li><li>3x I2C ports</li><li>High-powered piezo buzzer driver</li><li>High-power RGB LED</li><li>Safety switch / LED option</li></ul></li><li><p><strong>AI Mission Computer</strong></p><ul><li>6-Core CPU: Dual-Core Cortex-A72 + Quad-Core Cortex-A53</li><li>GPU Mali-T864, OpenGL ES1.1/2.0/3.0/3.1</li><li>VPU with 4K VP8/9, 4K 10bits H265/H264 60fps Decoding</li><li>Remote power control, software reset, power down, RTC Wake-Up, sleep mode</li><li>RAM Dual-Channel 4GB LPDDR4</li><li>16GB eMMC</li><li>MicroSD up to 256GB</li><li>Ethernet 10/100/1000 Native Gigabit</li><li>WiFi 802.11a/b/g/n/ac, Bluetooth</li><li>USB 3.0 Type C</li><li>2x Video: 4-Lane MIPI CSI (FPV Camera) and 4-Lane MIPI CSI with HMDI Input (Payload Camera)</li></ul></li><li><p><strong>LTE/5G Connectivity Module</strong></p><ul><li>Up to 600 Mbps bandwidth</li><li>5G sub-6 and mmWave, SA and NSA operations</li><li>4G Cat 20, up to 7xCA, 256-QAM DL/UL, 2xCA UL</li><li>4 x 4 MIMO for 4G and 5G (sub-6 bands)</li><li>3G HSPA+</li><li>Approved by JRL/JTBL, FCC, PTCRB, RED, GCF</li><li>Antenna, 4x4 MIMO</li><li>Bands: Worldwide</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Purchase from the original Sky-Drones Store (worldwide shipping with 1-2 days order processing time):</p><ul><li><a href="https://sky-drones.com/sets/airlink-enterprise-set.html" target="_blank" rel="noreferrer">Buy AIRLink Enterprise 4G</a></li><li><a href="https://sky-drones.com/sets/airlink-5g-enterprise-set.html" target="_blank" rel="noreferrer">Buy AIRLink Enterprise 5G</a></li><li><a href="https://sky-drones.com/autopilots/airlink-core.html" target="_blank" rel="noreferrer">Buy AIRLink Core 4G</a></li><li><a href="https://sky-drones.com/store/airlink-5g-core.html" target="_blank" rel="noreferrer">Buy AIRLink Core 5G</a></li></ul><h2 id="airlink-enterprise-kit-accessories" tabindex="-1">AIRLink Enterprise Kit Accessories <a class="header-anchor" href="#airlink-enterprise-kit-accessories" aria-label="Permalink to &quot;AIRLink Enterprise Kit Accessories&quot;">​</a></h2>',6),S=t("p",null,[t("div",{class:"embed-responsive embed-responsive-16by9"},[t("iframe",{class:"embed-responsive-item youtube-player",type:"text/html",width:"640",height:"390",src:"https://www.youtube.com/embed/lex7axW8WQg",frameborder:"0",webkitallowfullscreen:"",mozallowfullscreen:"",allowfullscreen:""})])],-1),A=e('<p>AIRLink Enterprise arrives with everything needed to setup the autopilot system.</p><p>The standard set contains:</p><ul><li>1x AIRLink Enterprise unit</li><li>1x FPV camera with CSI cable</li><li>1x WiFi antenna with MMCX connector</li><li>2x/4x LTE/5G antenna with MMCX connector</li><li>1x HDMI to mini HDMI cable1x set of cables (7 cables for all connectors)</li></ul><p><a href="https://sky-drones.com/sets/airlink-telemetry-set.html" target="_blank" rel="noreferrer">AIRLink Telemetry</a> based on the Microhard LAN/IP-based RF micromodule is available as an add-on and is fully compatible with AIRLink.</p><h2 id="editions" tabindex="-1">Editions <a class="header-anchor" href="#editions" aria-label="Permalink to &quot;Editions&quot;">​</a></h2><p>There are AIRLink editions that offer different integration levels required by drone manufacturers: <em>Enterprise</em> and <em>Core</em>. AIRLink Enterprise is ideal for a quick start, evaluation and prototyping while Core is optimised for deep integration and mid-high volume manufacturing.</p><p><strong>AIRLink Enterprise</strong></p><p>SmartAP AIRLink&#39;s Enterprise edition is intended for prototyping and low to medium volume drone production. Quick and easy installation thanks to the dedicated mounting holes and integrated heatsink for power dissipation.</p><p><img src="'+r+'" alt="AIRLink Enterprise"></p><p><strong>AIRLink Core</strong></p><p>SmartAP AIRLink&#39;s Core edition is intended for medium to high volume production and deep integration with customer&#39;s hardware. It weighs only 89 g and can be attached to a metal frame for optimum cooling.</p><p><img src="'+i+'" alt="AIRLink Core"></p><table><thead><tr><th>Parameter</th><th>AIRLink Enterprise</th><th>AIRLink Core</th></tr></thead><tbody><tr><td>Enclosure</td><td>Aluminum, with integrated heatsink and fan mounting option.</td><td>External heatsink or reasonable power dissipation should be provided by the design.</td></tr><tr><td>Dimensions</td><td>L103 x W61 x H37 mm</td><td>L100 x W57 x H22 mm</td></tr><tr><td>Weight</td><td>198 g</td><td>89 g</td></tr><tr><td>Ambient temperature</td><td>-40°C-..+50°C</td><td>-40°C-..+50°C</td></tr></tbody></table><h2 id="key-features" tabindex="-1">Key Features <a class="header-anchor" href="#key-features" aria-label="Permalink to &quot;Key Features&quot;">​</a></h2><ul><li><p><strong>Easy to mount</strong></p><p><img src="'+a+'" alt="Easy mount"></p></li><li><p><strong>FPV camera comes as standard</strong></p><p><img src="'+n+'" alt="FPV camera comes as standard"></p></li></ul><h2 id="interfaces" tabindex="-1">Interfaces <a class="header-anchor" href="#interfaces" aria-label="Permalink to &quot;Interfaces&quot;">​</a></h2><h3 id="left-side" tabindex="-1">Left Side <a class="header-anchor" href="#left-side" aria-label="Permalink to &quot;Left Side&quot;">​</a></h3><p><img src="'+o+'" alt="Left side"></p><ul><li><p><strong>Left side interfaces:</strong></p><ul><li>Power input with voltage &amp; current monitoring</li><li>AI Mission Computer micro SD card</li><li>Flight Controller micro SD card</li><li>AI Mission Computer USB Type-C</li><li>PPM input, SBUS output, RSSI monitor</li></ul></li><li><p><strong>POWER - JST GH SM10B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>12V</td><td>IN</td><td>+12V</td><td>Main power input</td></tr><tr><td>2</td><td>12V</td><td>IN</td><td>+12V</td><td>Main power input</td></tr><tr><td>3</td><td>12V</td><td>IN</td><td>+12V</td><td>Main power input</td></tr><tr><td>4</td><td>BAT_CURRENT</td><td>IN</td><td>+3.3V</td><td>Battery current monitoring</td></tr><tr><td>5</td><td>BAT_VOLTAGE</td><td>IN</td><td>+3.3V</td><td>Battery voltage monitoring</td></tr><tr><td>6</td><td>3V3</td><td>OUT</td><td>+3.3V</td><td>3.3V output</td></tr><tr><td>7</td><td>PWR_KEY</td><td>IN</td><td>+3.3V</td><td>Power key input</td></tr><tr><td>8</td><td>GND</td><td>Ground</td><td></td><td></td></tr><tr><td>9</td><td>GND</td><td>Ground</td><td></td><td></td></tr><tr><td>10</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>CPU SD card - microSD</strong></p></li><li><p><strong>CPU USB - USB Type C</strong></p></li><li><p><strong>RC Connector - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>5V output</td></tr><tr><td>2</td><td>PPM_IN</td><td>IN</td><td>+3.3V</td><td>PPM input</td></tr><tr><td>3</td><td>RSSI_IN</td><td>IN</td><td>+3.3V</td><td>RSSI input</td></tr><tr><td>4</td><td>FAN_OUT</td><td>OUT</td><td>+5V</td><td>Fan output</td></tr><tr><td>5</td><td>SBUS_OUT</td><td>OUT</td><td>+3.3V</td><td>SBUS output</td></tr></tbody></table></li></ul><ul><li><strong>FMU SD card - microSD</strong></li></ul><h3 id="right-side" tabindex="-1">Right Side <a class="header-anchor" href="#right-side" aria-label="Permalink to &quot;Right Side&quot;">​</a></h3><p><img src="'+l+'" alt="Right side"></p><ul><li><p><strong>Right side interfaces:</strong></p><ul><li>Ethernet port with power output</li><li>Telemetry port</li><li>Second GPS port</li><li>Spare I2C / UART port</li><li>Flight controller USB Type-C</li><li>Micro SIM Card</li><li>HDMI input port (payload camera)</li></ul></li><li><p><strong>ETHERNET - JST GH SM08B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Radio module power supply</td></tr><tr><td>2</td><td>5V</td><td>OUT</td><td>+5V</td><td>Radio module power supply</td></tr><tr><td>3</td><td>ETH_TXP</td><td>OUT</td><td>+3.3V</td><td>Ethernet transmit positive</td></tr><tr><td>4</td><td>ETH_TXN</td><td>OUT</td><td>+3.3V</td><td>Ethernet transmit negative</td></tr><tr><td>5</td><td>ETH_RXP</td><td>IN</td><td>+3.3V</td><td>Ethernet receive positive</td></tr><tr><td>6</td><td>ETH_RXN</td><td>IN</td><td>+3.3V</td><td>Ethernet receive negative</td></tr><tr><td>7</td><td>GND</td><td>Ground</td><td></td><td></td></tr><tr><td>8</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>TEL3 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Power supply output</td></tr><tr><td>2</td><td>USART2_TX</td><td>OUT</td><td>+3.3V</td><td>Telemetry 3 TX</td></tr><tr><td>3</td><td>USART2_RX</td><td>IN</td><td>+3.3V</td><td>Telemetry 3 RX</td></tr><tr><td>4</td><td>USART2_CTS</td><td>IN</td><td>+3.3V</td><td>Telemetry 3 CTS</td></tr><tr><td>5</td><td>USART2_RTS</td><td>OUT</td><td>+3.3V</td><td>Telemetry 3 RTS</td></tr><tr><td>6</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>I2C3 / UART4 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Power supply output</td></tr><tr><td>2</td><td>USART4_TX</td><td>OUT</td><td>+3.3V</td><td>UART 4 TX</td></tr><tr><td>3</td><td>USART4_RX</td><td>IN</td><td>+3.3V</td><td>UART 4 RX</td></tr><tr><td>4</td><td>I2C3_SCL</td><td>I/O</td><td>+3.3V</td><td>I2C3 Clock</td></tr><tr><td>5</td><td>I2C3_SDA</td><td>I/O</td><td>+3.3V</td><td>I2C3 Data</td></tr><tr><td>6</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>GPS2 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Power supply output</td></tr><tr><td>2</td><td>USART8_TX</td><td>OUT</td><td>+3.3V</td><td>UART 8 TX</td></tr><tr><td>3</td><td>USART8_RX</td><td>IN</td><td>+3.3V</td><td>UART 8 RX</td></tr><tr><td>4</td><td>I2C2_SCL</td><td>I/O</td><td>+3.3V</td><td>I2C2 Clock</td></tr><tr><td>5</td><td>I2C2_SDA</td><td>I/O</td><td>+3.3V</td><td>I2C2 Data</td></tr><tr><td>6</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>FMU USB - USB Type C</strong></p></li><li><p><strong>SIM Card - micro SIM</strong></p></li><li><p><strong>HDMI - mini HDMI</strong></p></li></ul><h3 id="front-side" tabindex="-1">Front Side <a class="header-anchor" href="#front-side" aria-label="Permalink to &quot;Front Side&quot;">​</a></h3><p><img src="'+s+'" alt="Front side"></p><ul><li><p><strong>Front side interfaces:</strong></p><ul><li>Main GNSS and compass port</li><li>Main telemetry port</li><li>CSI camera input</li><li>CAN 1</li><li>CAN 2</li></ul></li><li><p><strong>TEL1 - JST GH SM06B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Power supply output</td></tr><tr><td>2</td><td>USART7_TX</td><td>OUT</td><td>+3.3V</td><td>Telemetry 1 TX</td></tr><tr><td>3</td><td>USART7_RX</td><td>IN</td><td>+3.3V</td><td>Telemetry 1 RX</td></tr><tr><td>4</td><td>USART7_CTS</td><td>IN</td><td>+3.3V</td><td>Telemetry 1 CTS</td></tr><tr><td>5</td><td>USART7_RTS</td><td>OUT</td><td>+3.3V</td><td>Telemetry 1 RTS</td></tr><tr><td>6</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>GPS1 - JST GH SM10B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Power supply output</td></tr><tr><td>2</td><td>USART1_TX</td><td>OUT</td><td>+3.3V</td><td>GPS 1 TX</td></tr><tr><td>3</td><td>USART1_RX</td><td>IN</td><td>+3.3V</td><td>GPS 1 RX</td></tr><tr><td>4</td><td>I2C1_SCL</td><td>I/O</td><td>+3.3V</td><td>Mag 1 Clock</td></tr><tr><td>5</td><td>I2C1_SDA</td><td>I/O</td><td>+3.3V</td><td>Mag 1 Data</td></tr><tr><td>6</td><td>SAFETY_BTN</td><td>IN</td><td>+3.3V</td><td>Safety button</td></tr><tr><td>7</td><td>SAFETY_LED</td><td>OUT</td><td>+3.3V</td><td>Safety LED</td></tr><tr><td>8</td><td>+3V3</td><td>OUT</td><td>+3.3V</td><td>3.3V output</td></tr><tr><td>9</td><td>BUZZER</td><td>OUT</td><td>+5V</td><td>Buzzer output</td></tr><tr><td>10</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>CAN1 - JST GH SM04B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Power supply output</td></tr><tr><td>2</td><td>CAN1_H</td><td>I/O</td><td>+5V</td><td>CAN 1 High (120Ω)</td></tr><tr><td>3</td><td>CAN1_L</td><td>I/O</td><td>+5V</td><td>CAN 1 Low (120Ω)</td></tr><tr><td>4</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>CAN2 - JST GH SM04B-GHS-TB</strong></p><table><thead><tr><th>Pin number</th><th>Pin name</th><th>Direction</th><th>Voltage</th><th>Function</th></tr></thead><tbody><tr><td>1</td><td>5V</td><td>OUT</td><td>+5V</td><td>Power supply output</td></tr><tr><td>2</td><td>CAN2_H</td><td>I/O</td><td>+5V</td><td>CAN 2 High (120Ω)</td></tr><tr><td>3</td><td>CAN2_L</td><td>I/O</td><td>+5V</td><td>CAN 2 Low (120Ω)</td></tr><tr><td>4</td><td>GND</td><td>Ground</td><td></td><td></td></tr></tbody></table></li><li><p><strong>CAMERA - FPC 30 pin, 0.5mm pitch</strong></p></li></ul><h3 id="rear-side" tabindex="-1">Rear Side <a class="header-anchor" href="#rear-side" aria-label="Permalink to &quot;Rear Side&quot;">​</a></h3><p><img src="'+h+'" alt="Back side"></p><ul><li><p><strong>Rear side interfaces:</strong></p><ul><li>SBUS input</li><li>16 PWM output channels</li><li>2x LTE antenna sockets (MIMO)</li><li>WiFi antenna socket (AP &amp; Station modes)</li></ul></li></ul><h1 id="serial-mapping" tabindex="-1">Serial Mapping <a class="header-anchor" href="#serial-mapping" aria-label="Permalink to &quot;Serial Mapping&quot;">​</a></h1><p>AIRLink has a large number of internal and external serial ports:</p><table><thead><tr><th>Serial</th><th>UART</th><th>Function</th></tr></thead><tbody><tr><td>Serial 0</td><td>USB</td><td>Console</td></tr><tr><td>Serial 1</td><td>UART 7</td><td>Telemetry 1</td></tr><tr><td>Serial 2</td><td>UART 5</td><td>Telemetry 2 (used internally with Mission Computer)</td></tr><tr><td>Serial 3</td><td>USART 1</td><td>GPS 1</td></tr><tr><td>Serial 4</td><td>UART 8</td><td>GPS 2</td></tr><tr><td>Serial 5</td><td>USART 3</td><td>Debug console (internal connector)</td></tr><tr><td>Serial 6</td><td>USART 2</td><td>Telemetry 3</td></tr><tr><td>Serial 7</td><td>UART 4</td><td>External UART</td></tr></tbody></table><h2 id="rc-input" tabindex="-1">RC Input <a class="header-anchor" href="#rc-input" aria-label="Permalink to &quot;RC Input&quot;">​</a></h2><p>RC input is configured on the SBUS pin and is connected to IO MCU via an inverter internally. For PPM receivers please use RC Connector PPM pin located on the left side of the unit.</p><p><img src="'+p+'" alt="RC Input"></p><h2 id="outputs" tabindex="-1">Outputs <a class="header-anchor" href="#outputs" aria-label="Permalink to &quot;Outputs&quot;">​</a></h2><p>AIRLink has 16 PWM ouputs. Main outputs 1-8 and connected to IO MCU. AUX outputs 1-8 are connected to FMU.</p><table><thead><tr><th>Output</th><th>Timer</th><th>Channel</th></tr></thead><tbody><tr><td>AUX 1</td><td>Timer 1</td><td>Channel 4</td></tr><tr><td>AUX 2</td><td>Timer 1</td><td>Channel 3</td></tr><tr><td>AUX 3</td><td>Timer 1</td><td>Channel 2</td></tr><tr><td>AUX 4</td><td>Timer 1</td><td>Channel 1</td></tr><tr><td>AUX 5</td><td>Timer 4</td><td>Channel 2</td></tr><tr><td>AUX 6</td><td>Timer 4</td><td>Channel 3</td></tr><tr><td>AUX 7</td><td>Timer 12</td><td>Channel 1</td></tr><tr><td>AUX 8</td><td>Timer 12</td><td>Channel 2</td></tr></tbody></table><p><a href="./../peripherals/dshot.html">DShot</a> can be used on the first four AUX pins.</p><h2 id="building-firmware" tabindex="-1">Building Firmware <a class="header-anchor" href="#building-firmware" aria-label="Permalink to &quot;Building Firmware&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make sky-drones_smartap-airlink</span></span></code></pre></div><h2 id="peripherals" tabindex="-1">Peripherals <a class="header-anchor" href="#peripherals" aria-label="Permalink to &quot;Peripherals&quot;">​</a></h2><ul><li><a href="./../gps_compass/gps_smartap.html">SmartAP GPS</a> - GPS module with compass, pressure sensor and RGB LED</li><li><a href="./../power_module/sky-drones_smartap-pdb.html">SmartAP PDB</a> - Power Distribution Board</li></ul><h2 id="reference-design" tabindex="-1">Reference Design <a class="header-anchor" href="#reference-design" aria-label="Permalink to &quot;Reference Design&quot;">​</a></h2><p><img src="'+u+'" alt="Reference design"></p><p>AIRLink CAD model is available <a href="https://docs.sky-drones.com/airlink/cad-model" target="_blank" rel="noreferrer">here</a></p><p>AIRLink Reference design can be provided by request. Get in touch at <a href="https://sky-drones.com/contact-us" target="_blank" rel="noreferrer">Sky-Drones contact page</a></p><h2 id="more-information" tabindex="-1">More Information <a class="header-anchor" href="#more-information" aria-label="Permalink to &quot;More Information&quot;">​</a></h2><p>For more information and instructions on setting up and using the AIRLink system see <a href="https://docs.sky-drones.com/airlink/" target="_blank" rel="noreferrer">AIRLink Documentation</a>.</p><p>For technical help, support and customization please get in touch at <a href="https://sky-drones.com/contact-us" target="_blank" rel="noreferrer">Sky-Drones contact page</a>.</p><p>More information can be found at <a href="https://sky-drones.com" target="_blank" rel="noreferrer">www.sky-drones.com</a>.</p><p>Frequently asked questions are answered in <a href="https://docs.sky-drones.com/airlink/faq" target="_blank" rel="noreferrer">FAQ</a>.</p><h2 id="useful-links" tabindex="-1">Useful Links <a class="header-anchor" href="#useful-links" aria-label="Permalink to &quot;Useful Links&quot;">​</a></h2><ul><li><a href="https://sky-drones.com/airlink" target="_blank" rel="noreferrer">AIRLink product page</a></li><li><a href="https://docs.sky-drones.com/avionics/airlink" target="_blank" rel="noreferrer">AIRLink documentation</a></li><li><a href="https://3182378893-files.gitbook.io/~/files/v0/b/gitbook-x-prod.appspot.com/o/spaces%2F-MTMlWysgDtJq8Hid1v7%2Fuploads%2F8AiuNNSwLYnZSscj7uIV%2FAIRLink-Datasheet.pdf?alt=media&amp;token=cbf0c4bf-9ab1-40c5-a0af-c6babdddb690" target="_blank" rel="noreferrer">AIRLink datasheet</a></li><li><a href="https://sky-drones.com/sets/airlink-enterprise-set.html" target="_blank" rel="noreferrer">Buy AIRLink Enterprise 4G</a></li><li><a href="https://sky-drones.com/sets/airlink-5g-enterprise-set.html" target="_blank" rel="noreferrer">Buy AIRLink Enterprise 5G</a></li><li><a href="https://sky-drones.com/autopilots/airlink-core.html" target="_blank" rel="noreferrer">Buy AIRLink Core 4G</a></li><li><a href="https://sky-drones.com/store/airlink-5g-core.html" target="_blank" rel="noreferrer">Buy AIRLink Core 5G</a></li></ul>',56),y=[f,T,k,S,A];function _(I,R,C,P,U,V){return g(),m("div",null,y)}c